import React, {Component} from 'react';
import './../../../css/Selab.scss';

class Contact extends Component {
    //메인 화면
    render() {
        return(
            <div className="Lab-contents" id="LabContact"
            style={{display: 'none'}}>
              연구실 연락처
            </div>
        );
    }
}

export default Contact;
